(window.webpackJsonp=window.webpackJsonp||[]).push([[2254],{2610:function(n,h,i){"use strict";i.r(h);var t=i(44),g=Object(t.a)({},(function(){var n=this,h=n.$createElement,i=n._self._c||h;return i("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[i("h1",{attrs:{id:"chuong-951-that-gia-kim-diep-vuong-thuong"}},[i("a",{staticClass:"header-anchor",attrs:{href:"#chuong-951-that-gia-kim-diep-vuong-thuong"}},[n._v("#")]),n._v(" Chương 951: Thật giả Kim Diệp Vương (thượng)")]),n._v(" "),i("hr"),n._v(" "),i("p",[n._v("Chương 951: Thật giả Kim Diệp Vương (thượng) "),i("br"),i("br"),n._v("Đông Việt sững sờ, giật nảy mình, bờ môi run rẩy: “Kim, diệp, vương...”"),i("br"),i("br"),n._v("Vừa tới một vị, tại sao lại xuất hiện một cái?"),i("br"),i("br"),n._v("Kim Diệp Vương không phải chỉ có một cái ư? Lúc nào nhiều một cái tiếp một cái?"),i("br"),i("br"),n._v("“Nhìn thấy vương gia, còn không hạ bái? Làm sao đi ra một đoạn thời gian, một điểm quy củ cũng không có!”"),i("br"),i("br"),n._v("Thấy thuộc hạ của mình, con mắt trừng trừng, một bộ vẻ mặt như gặp phải quỷ, không có bất kỳ cái gì lễ tiết, Thanh Diệp Vương lông mày nhíu một cái."),i("br"),i("br"),n._v("“Là thuộc hạ nhất thời quá mức khiếp sợ, có chút thất lễ...” Đông Việt vội vàng quỳ mọp xuống đất."),i("br"),i("br"),n._v("“Khiếp sợ?” Thanh Diệp Vương nghi ngờ."),i("br"),i("br"),n._v("Hắn cái này thuộc hạ, mặc dù thực lực không cao, năng lực lại là cực mạnh, bằng không thì cũng sẽ không bị bản thân ủy thác trách nhiệm phái đến nơi đây, có thể để cho hắn thất thố như vậy, liền lễ tiết đều quên, chuyện gì xảy ra?"),i("br"),i("br"),n._v("“Là, là... Trước đó đến rồi một vị cường đại tộc nhân, tự xưng Kim Diệp Vương, nghe được vị này cũng thế, cho nên thất thố...”"),i("br"),i("br"),n._v("Đông Việt vội vàng giải thích."),i("br"),i("br"),n._v("“Tự xưng Kim Diệp Vương?”"),i("br"),i("br"),n._v("Thanh Diệp Vương cùng Kim Diệp Vương liếc mắt nhìn nhau, đồng thời sửng sốt."),i("br"),i("br"),n._v("“Có ý tứ gì? Ngươi nói là, có người giả mạo ta?” Sầm mặt lại, Kim Diệp Vương tiến về phía trước một bước."),i("br"),i("br"),n._v("“Cái này...” Đông Việt không biết trả lời như thế nào."),i("br"),i("br"),n._v("“Đến cùng chuyện gì xảy ra?” Thanh Diệp Vương nhìn lại."),i("br"),i("br"),n._v("“Bẩm báo vương gia, là như vậy, vừa rồi ta phái người vây giết danh sư, một cái tộc nhân xuất hiện, nói mình là Kim Diệp Vương, hiện tại... Đang đang tra hỏi những danh sư kia, còn chưa rời khỏi.”"),i("br"),i("br"),n._v("Đông Việt vội vàng đem chuyện vừa rồi nói một lần."),i("br"),i("br"),n._v("“Tự xưng Kim Diệp Vương?”"),i("br"),i("br"),n._v("“Thẩm vấn danh sư?”"),i("br"),i("br"),n._v("Hai vị vương gia đồng thời cau mày."),i("br"),i("br"),n._v("“Dẫn chúng ta qua đi, ta ngược lại muốn xem xem, ai dám giả mạo ta!”"),i("br"),i("br"),n._v("Sầm mặt lại, Kim Diệp Vương trên người sát khí sôi trào, tựa như lúc nào cũng sẽ bùng nổ."),i("br"),i("br"),n._v("Đường đường Dị Linh tộc Vương Giả, bị người giả mạo, đổi lại ai, đều sẽ không chịu nổi."),i("br"),i("br"),n._v("Đông Việt nhìn bản thân vương gia liếc mắt, thấy hắn gật đầu, lúc này mới lên tiếng, phía trước dẫn đường: “Hai vị vương gia mời tới bên này!”"),i("br"),i("br"),n._v("“Trước không vội, trước phái người đem chung quanh lặng lẽ bao vây, tuyệt đối không nên rút dây động rừng, sau đó lại đi qua!”"),i("br"),i("br"),n._v("Đi hai bước, Thanh Diệp Vương ngừng lại, phân phó nói."),i("br"),i("br"),n._v("“Vâng!”"),i("br"),i("br"),n._v("Đông Việt nhẹ gật đầu."),i("br"),i("br"),n._v("Nếu như đối phương thật hay giả, dụng ý khó dò, làm người sợ run, tự nhiên muốn bắt lấy thẩm vấn, biết mục đích như thế nào."),i("br"),i("br"),n._v("Đi ra khỏi cửa phòng, Đông Việt phân phó vài câu, nghe được mệnh lệnh của hắn, trước đó hơn hai trăm vị Dị Linh tộc nhân, đồng thời thoát ra, lặng yên không tiếng động đem Trương Huyền tiến vào cung điện, vây lại."),i("br"),i("br"),n._v("Những này Dị Linh tộc nhân, tiến thối có thứ tự, vây công thời điểm, sắp chết sừng toàn bộ bao vây, đừng nói Trương Huyền, coi như Thánh vực tam trọng cường giả, muốn chạy ra, đều gần như không có khả năng."),i("br"),i("br"),n._v("“Được rồi, dẫn chúng ta qua đi xem một chút!”"),i("br"),i("br"),n._v("Thấy chuẩn bị ổn thoả, Thanh Diệp Vương khoát tay chặn lại, mấy người vội vã hướng về phía trước cung điện đi tới."),i("br"),i("br"),n._v("..."),i("br"),i("br"),n._v("“Các ngươi có thể không tin ta, nhưng có thể ngược lại nghĩ một hồi, nếu như ta thật sự là Dị Linh tộc Vương Giả, sẽ cùng các ngươi nói nhảm? Chỉ sợ trực tiếp phái người đem ngươi bọn họ toàn giết sạch đi!”"),i("br"),i("br"),n._v("Thấy mọi người đối hắn, một cái dấu chấm câu đều không tin, Trương Huyền tràn đầy bất đắc dĩ khoát tay áo."),i("br"),i("br"),n._v("“Ngươi khẳng định là muốn từ chúng ta trong miệng đạt được tin tức gì... Cố ý lấy lòng, tới lơ là chúng ta...” Một cái danh sư cắn răng."),i("br"),i("br"),n._v("“Nhận được tin tức?”"),i("br"),i("br"),n._v("Trương Huyền lắc đầu: “Ta là danh sư học viện viện trưởng, bí mật gì không biết, còn cần theo trong miệng các ngươi thu hoạch được? Ngươi cảm thấy... Thân phận của các ngươi so ra mà vượt một vị viện trưởng?”"),i("br"),i("br"),n._v("“Cái này...”"),i("br"),i("br"),n._v("Mọi người ngẩn ngơ."),i("br"),i("br"),n._v("“Mọi người đừng tin hắn miệng lưỡi dẻo quẹo! Coi như danh sư học viện viện trưởng, địa vị kính trọng, cũng không có khả năng cái gì cũng biết! Hắn bắt lấy chúng ta, khẳng định là muốn biết Địa quật bí mật...”"),i("br"),i("br"),n._v("Lục Phong gào thét."),i("br"),i("br"),n._v("Hắn nếm qua kẻ trước mắt này một lần thua thiệt, đối hắn, sẽ không bao giờ lại tin tưởng."),i("br"),i("br"),n._v("“Không sai, đừng tin hắn! Không phải tộc ta, trong lòng ắt nghĩ khác! Nếu như hắn không phải, làm sao lại xuất hiện tại đây? Sao có thể để nhiều như vậy Dị Linh tộc nhân ngoan ngoãn nghe theo mệnh lệnh?”"),i("br"),i("br"),n._v("“Những người này, quỷ kế đa đoan, cố ý lấy lòng, khẳng định là có mưu đồ... Mọi người tuyệt đối đừng mắc lừa!”"),i("br"),i("br"),n._v("Lại có tiếng sư trưởng hú."),i("br"),i("br"),n._v("“Các ngươi...”"),i("br"),i("br"),n._v("Trương Huyền con mắt xoay loạn."),i("br"),i("br"),n._v("Cứu người cứu được cầu gia gia bảo nãi nãi, người ta còn không lĩnh tình... Cũng thật sự là say."),i("br"),i("br"),n._v("“Có mưu đồ... Các ngươi một đám già yếu tàn tật, bất cứ lúc nào cũng sẽ treo gia hỏa, có cái gì có thể để ta mưu đồ?” Cũng nhịn không được nữa, Trương Huyền khẽ nói."),i("br"),i("br"),n._v("Liền các ngươi đám người này bộ dạng, cộng lại mấy chục vạn tuổi, có mưu đồ, có cái gì có thể mưu đồ?"),i("br"),i("br"),n._v("“Chúng ta...”"),i("br"),i("br"),n._v("Một vị danh sư đang muốn nói chuyện, đột nhiên Tử Dương thú sầm mặt lại: “Chủ nhân, không xong, chung quanh đều bị phong tỏa...”"),i("br"),i("br"),n._v("Nó đã đạt tới Thần Thức cảnh, so tất cả mọi người ở đây đều mẫn cảm, động tĩnh bên ngoài mặc dù rất nhỏ, vẫn là phát giác."),i("br"),i("br"),n._v("“Bao vây?”"),i("br"),i("br"),n._v("Trương Huyền sững sờ, vội vàng xoay người, Minh Lý Chi Nhãn nhúc nhích, mượn nhờ cửa sổ hướng nhìn ra ngoài, quả nhiên thấy màn đêm đen kịt bên trong, vô số Dị Linh tộc nhân đem chung quanh toàn bộ bao vây, mặc dù nguyên một đám ẩn giấu đi khí tức, nhưng mà chỉ cần có người muốn từ nơi này ra ngoài, tất nhiên bộc phát lôi đình một kích."),i("br"),n._v(" “Chuyện gì xảy ra?” Trái tim thoáng cái nguội đi, Trương Huyền vẻ mặt nghiêm túc."),i("br"),i("br"),n._v("Vừa rồi không còn rất tốt, đối lời của mình tin tưởng không nghi ngờ ư?"),i("br"),i("br"),n._v("Làm sao mới một hồi, liền đem chung quanh toàn phong tỏa, xem ra không phải muốn giết chết bản thân không bỏ qua?"),i("br"),i("br"),n._v("“Ngươi về trước đi...”"),i("br"),i("br"),n._v("Nhìn một cái, Trương Huyền liền biết, muốn chạy trốn là không thể nào, đối Tử Dương thú khoát tay áo."),i("br"),i("br"),n._v("“Vâng!” Tử Dương thú nhẹ gật đầu, thân thể nhoáng một cái, bị thu vào Thiên Nghĩ Phong sào."),i("br"),i("br"),n._v("Đưa nó lấy đi, Trương Huyền thân thể nhúc nhích, lần nữa biến thành Dị Linh tộc nhân diện mạo."),i("br"),i("br"),n._v("Mới vừa biến xong, liền nghe đến cung điện cổng “Kẹt kẹt” một tiếng, bị người từ bên ngoài mở ra, ba bóng người sải bước đi đi vào."),i("br"),i("br"),n._v("Đi đầu một cái, đang là trước kia Đông Việt, mà sau lưng hai vị, mười phần lạ mặt, có điều, lực lượng trong cơ thể nhưng dâng trào không ngừng, cho người ta một loại cảm giác áp bách mạnh mẽ."),i("br"),i("br"),n._v("“Thánh vực... Tứ trọng cường giả?”"),i("br"),i("br"),n._v("Da mặt nhảy một cái, Trương Huyền ống tay áo ở dưới nắm đấm, nhịn không được xiết chặt."),i("br"),i("br"),n._v("Hai vị này, lại là đạt tới Thánh vực tứ trọng cường giả."),i("br"),i("br"),n._v("Trước đó còn đang suy nghĩ, thực sự không được, dùng Kim Nguyên đỉnh giết ra một đường máu, thuận tiện chạy trốn, nắm giữ loại cường giả cấp bậc này tại, cơ bản bằng không nhìn."),i("br"),i("br"),n._v("Biết không thể chạy trốn, Trương Huyền mặc dù khẩn trương, nhưng cũng biết, phải gìn giữ tỉnh táo, tâm cảnh lặng lẽ vận chuyển, cả người rất nhanh khôi phục lại tới."),i("br"),i("br"),n._v("“Đông Việt, ta không phải đã nói không nên để cho người qua tới quấy rầy ư? Làm sao, thật chẳng lẽ cho là ta không dám giết ngươi?”"),i("br"),i("br"),n._v("Sầm mặt lại, giữa hai lông mày để lộ ra sát khí."),i("br"),i("br"),n._v("Mặc dù không biết để lộ ra sơ hở ở chỗ nào, làm cho đối phương nhìn ra, nhưng bây giờ, chỉ có thể tiếp tục ngụy trang tiếp, nếu không, làm không cẩn thận thật có khả năng chết ở chỗ này."),i("br"),i("br"),n._v("Nếu là đám này ngốc hàng danh sư, sớm một chút tin tưởng mình, hiện tại khả năng đã trốn, cái nào còn bị động như thế!"),i("br"),i("br"),n._v("“Không là tại hạ lỗ mãng, mà là... Nhà chúng ta vương gia cùng Kim Diệp Vương đến, nghe nói ngươi cũng tự xưng Kim Diệp Vương, cho nên tới xem một chút...”"),i("br"),i("br"),n._v("Đông Việt nói."),i("br"),i("br"),n._v("“Nhà các ngươi vương gia? Kim Diệp Vương?” Mắt tối sầm lại, Trương Huyền thiếu chút nữa ngất đi."),i("br"),i("br"),n._v("Sẽ không như thế xui xẻo!"),i("br"),i("br"),n._v("Liền ngụy trang một hồi, mượn dùng đối phương tên tuổi mà thôi, bản tôn liền đến, thật hay giả?"),i("br"),i("br"),n._v("Lần trước là Độc điện, ngụy trang đặc sứ, kết quả, không có giả bộ bao lâu, người ta thật liền đến, làm cho suýt chút nữa lật thuyền, lần này càng xui xẻo, ngụy trang Kim Diệp Vương, không chỉ hắn đến rồi, liền Thanh Diệp Vương đều tới..."),i("br"),i("br"),n._v("Ý tưởng làm sao đen đủi như vậy?"),i("br"),i("br"),n._v("“Ngươi là ai? Vì sao phải mạo danh dùng tên của ta?” Nhìn thấy người trước mắt này, ngụy trang bản thân, Kim Diệp Vương khuôn mặt xanh xám, như là đáy nồi."),i("br"),i("br"),n._v("“Ngươi là ai?”"),i("br"),i("br"),n._v("Trương Huyền lông mày giương lên."),i("br"),i("br"),n._v("Không có đường lui khác, chỉ có thể đánh cược một lần."),i("br"),i("br"),n._v("“Ta là Kim Diệp Vương!” Kim Diệp Vương nói."),i("br"),i("br"),n._v("“Thật là lớn gan chó! Ở đâu ra gia hỏa, dám giả mạo tên của ta? Đông Việt, còn không phái người đem cái tên này cầm xuống!”"),i("br"),i("br"),n._v("Bàn tay lớn vẫy một cái, Trương Huyền lớn tiếng trách mắng, hai tay chắp sau lưng, phóng xuất ra khí tức cường đại cùng vô tận lực lượng: “Tại hạ mới là Kim Diệp Vương!”"),i("br"),i("br"),n._v("Nói xong, trên mặt cơ bắp nhúc nhích, thời gian nháy mắt, liền trở nên cùng đối diện “Kim Diệp Vương” giống nhau như đúc."),i("br"),i("br"),n._v("Lúc trước hắn chỉ là dựa theo bản thân khôi lỗi bộ dáng ngụy trang, hiện tại thật Kim Diệp Vương đến rồi, đương nhiên muốn giống như hắn."),i("br"),i("br"),n._v("“Ngươi...”"),i("br"),i("br"),n._v("Thấy cái tên này, không chỉ giả mạo hắn, còn tưởng là mặt biến thành hình dạng của mình, Kim Diệp Vương tức giận gần nổ."),i("br"),i("br"),n._v("Ngươi dám chơi lại giả một chút sao?"),i("br"),i("br"),n._v("Ở trước mặt biến thành hình dạng của ta, đây là làm tất cả mọi người mù ah!"),i("br"),i("br"),n._v("“Đây mới là ta vốn dung mạo, trước đó, chỉ là ngụy trang một chút, không muốn bộ mặt thật gặp người thôi!”"),i("br"),i("br"),n._v("Biến thành đối phương bộ đáng, Trương Huyền nói."),i("br"),i("br"),n._v("“Ngươi đến cùng là ai? Ta cùng Kim Diệp Vương cùng một chỗ xuyên qua phong ấn mà đến, thân phận của hắn tuyệt sẽ không là giả!”"),i("br"),i("br"),n._v("Thấy đối phương như vậy không có sợ hãi, Thanh Diệp Vương bây giờ nhìn không nổi nữa, nói."),i("br"),i("br"),n._v("Hắn cùng Kim Diệp Vương cùng đi đến, tự nhiên càng tin tưởng bên cạnh vị này."),i("br"),i("br"),n._v("“Không có giả?”"),i("br"),i("br"),n._v("Khoát tay áo, Trương Huyền than thở một tiếng, trên mặt lộ ra vẻ tiếc hận: “Thanh Diệp Vương, ngươi nghĩ quá đơn giản! Ngươi không biết cái tên này, ta lại là rất rõ ràng, trước đó liền ngụy trang qua ta, bị ta phát hiện về sau, giáo huấn một trận, ai biết quá mức giảo hoạt trốn! Không nghĩ tới, thế mà giả bộ đến nơi này, sớm biết như vậy, nên đánh chết tại chỗ, cũng không trở thành để thân phận của ta, thật giả không phân biệt...”"),i("br"),i("br"),n._v("“Ngươi nói cái gì?”"),i("br"),i("br"),n._v("Càng nghe càng cảm thấy nói chuyện không đâu, Kim Diệp Vương tức giận gần nổ, sát ý sôi trào, bất cứ lúc nào cũng sẽ ra tay."),i("br"),i("br"),n._v("Cái tên này không chỉ giả mạo hắn thì cũng thôi đi, còn nói như vậy hùng hồn, nghĩa chính ngôn từ... Ở đâu ra lá gan?"),i("br"),i("br"),n._v("Còn ngụy trang qua ngươi... Giáo huấn một lần..."),i("br"),i("br"),n._v("Ăn nói bừa bãi, thuận miệng liền đến..."),i("br"),i("br"),n._v("Mặt đâu?"),i("br"),i("br"),n._v("“Ta nói cái gì, trong lòng ngươi chẳng lẽ không rõ ràng ư?”"),i("br"),i("br"),n._v("Lắc đầu, Trương Huyền một mặt chỉ tiếc rèn sắt không thành thép: “Nghiệt súc, còn không mau mau hiện ra nguyên hình? Ta nuôi dưỡng ngươi nhiều năm như vậy, đối đãi ngươi như là thân tử, tay nắm tay truyền thụ cho ngươi công pháp võ kỹ, chỉ là muốn cho ngươi trở nên mạnh hơn, kết quả ngươi nhưng học được cuộc sống của ta quen thuộc, thậm chí võ công tuyệt chiêu, khắp nơi ngụy trang, giả danh lừa bịp... Quả thực vong ân phụ nghĩa tới cực điểm!”"),i("br"),i("br"),n._v("Nói đến đây, Trương Huyền nhìn về phía Thanh Diệp Vương cùng Đông Việt: “Lời nói thật nói với các ngươi đi, thật ra thì hắn là ta nuôi dưỡng một cái thú sủng, bởi vì nuôi niên kỉ số nhiều, đối ta đủ loại quen thuộc rõ như lòng bàn tay, mới có thể biến thành hình dạng của ta...”"),i("br"),i("br"),n._v("“Thú sủng?”"),i("br"),i("br"),n._v("Thanh Diệp Vương cùng Đông Việt đồng thời sững sờ."),i("br"),i("br"),n._v("Người sau nhịn không được nhìn qua: “Chúng ta linh tộc liền linh thú, Thánh thú đều không có, ở đâu ra thú sủng?”"),i("br"),i("br"),i("br"),i("br")]),n._v(" "),i("hr"),n._v(" "),i("p",[i("a",{attrs:{href:"./chap-959"}},[n._v("Chương trước")]),n._v("  |  "),i("a",{attrs:{href:"./chap-961"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);